export const addPost = () =>{
    const newPost = {
        id: 5,
        message: state.profileData.newPostMessage,
        likeCount: 0,
    }

    state.profileData.posts.push(newPost)
    state.profileData.newPostMessage = ''
    rerenderEntireTree(state, addPost);
}

export const changeNewPostMessage = (newText) =>{
    state.profileData.newPostMessage = newText;
    rerenderEntireTree(state);
}